package com.example.lab19;

import javafx.animation.Animation;
import javafx.animation.KeyFrame;
import javafx.animation.Timeline;
import javafx.application.Application;
import javafx.fxml.FXMLLoader;
import javafx.geometry.Pos;
import javafx.scene.Scene;
import javafx.scene.control.Button;
import javafx.scene.image.Image;
import javafx.scene.image.ImageView;
import javafx.scene.layout.BorderPane;
import javafx.scene.layout.HBox;
import javafx.scene.layout.Pane;
import javafx.scene.layout.StackPane;
import javafx.stage.Stage;
import javafx.util.Duration;

import java.io.IOException;

public class HelloApplication extends Application {
    @Override
    public void start(Stage stage) throws IOException {
        Image[] imageslist = new Image[5];
        imageslist[0] = new Image("data:image/jpeg;base64,");
        imageslist[1] = new Image("data:image/jpeg;base64,");
        imageslist[2] = new Image("data:image/jpeg;base64,");
        imageslist[3] = new Image("data:image/jpeg;base64,");
        imageslist[4] = new Image("data:image/jpeg;base64,");

        ImageView myImage = new ImageView(imageslist[(int) (Math.random() * 5)]);

        Timeline pics = new Timeline(new KeyFrame(Duration.seconds(2), e -> myImage.setImage(imageslist[(int) (Math.random() * 5)])));
        pics.setCycleCount(Timeline.INDEFINITE);
        pics.play();


        HBox buttons = new HBox();

        Button btPlayPause = new Button("Pause");
        buttons.getChildren().add(btPlayPause);
        btPlayPause.setOnAction(e -> {
            if (btPlayPause.getText().equals("Pause")) {
                btPlayPause.setText("Play");
                pics.stop();
            } else if (btPlayPause.getText().equals("Play")) {
                btPlayPause.setText("Pause");
                pics.play();
            }
        });


        Button btSpeedInc = new Button("Speed++");
        Button btSpeedDec = new Button("--Speed");
        btSpeedDec.setOnAction(e -> {
            if (pics.getRate() - 1 != 0)
                pics.setRate(pics.getRate() - 1);
            });
        btSpeedInc.setOnAction(e -> pics.setRate(pics.getRate() + 1));

        buttons.getChildren().add(0, btSpeedDec);
        buttons.getChildren().add(btSpeedInc);
        buttons.setAlignment(Pos.CENTER);


        BorderPane pane = new BorderPane();
        pane.setCenter(myImage);
        pane.setBottom(buttons);
        Scene scene = new Scene(pane);
        stage.setTitle("Lab19");
        stage.setScene(scene);
        stage.show();
    }

    public static void main(String[] args) {
        launch();
    }
}